from shapely.geometry import LineString

# Function to extract coordinates from LINESTRING input
def extract_coordinates(linestring):
    """
    Extract coordinates from a LINESTRING format string.
    Example input: 'LINESTRING(11.051559999999998 76.88735, 11.05144 76.88713)'
    """
    linestring = linestring.replace("LINESTRING(", "").replace(")", "")
    return [tuple(map(float, coord.split())) for coord in linestring.split(",")]

